import { sha256 } from 'js-sha256';
// import * as $ from 'jquery';
import { Container, Form } from 'react-bootstrap';


function Hash() {

    return (
        <Container>
            <Form>
                <Form.Group className="mb-3" controlId="dataPortion">
                    <Form.Label>Data: </Form.Label>
                    <Form.Control type="text" placeholder="" />
                    <Form.Text className="text-muted">
                        Type in anything you'd like!
                    </Form.Text>
                </Form.Group>

                <Form.Group className="mb-3" controlId="HashPortion">
                    <Form.Label>Hash</Form.Label>
                    <Form.Control type="hash" placeholder= {sha256('')} />
                </Form.Group>
            </Form>
        </Container>
    );
}

export default Hash;
